import React from "react";
import courthouse from "../assets/images/map_courthouse.png";

const Services = () => {
  return (
    <main>
      <section>
        <div className="custom-container">
          <div className="row">
            <div className="col-lg-3">
              <img src={courthouse} alt="" />
              <h5>Kommersiya hüququ</h5>
              <p>
                kommersiya, və ya sahibkarlıq (biznes) hüququ ticarət,
                kommersiya, satışla məşğul olan şəxslərin və hüquqlarına,
                münasibətlərinə və hərəkətlərinə tətbiq olunan hüquq sahəsidir.
                O, mülki hüququn sahələrindən biri hesab olunmaqla bərabər,
                xüsusi və ümumi hüquqla bağlı məsələlərin tənzimlənməsini həyata
                keçirir.
              </p>
            </div>
            <div className="col-lg-3"></div>
            <div className="col-lg-3"></div>
            <div className="col-lg-3"></div>
          </div>
        </div>
      </section>
    </main>
  );
};

export default Services;
